import isLoggedIn, { logOut, getCurrentUser } from "../utilities/loginStatus";

function UserHome() {
  if (getCurrentUser) {
    var user = getCurrentUser.username;
  }
  return (
    <>
      <p>Hello, {user}!</p>
      <a onClick={logOut}>Logout</a>
    </>
  );
}
export default UserHome;
